import Link from "next/link";
import {
  AppBar,
  Toolbar,
  Button,
  Typography,
  makeStyles,
  Grid,
  Box,
} from "@material-ui/core";
import MuiLink from "@material-ui/core/Link";

const useStyles = makeStyles((theme) => ({
  title: {
    flexGrow: 1,
  },
}));

const Header = () => {
  const classes = useStyles();

  return (
    <AppBar position="fixed">
      <Toolbar>
        <Grid container>
          <Grid item lg={1}></Grid>

          <Grid item lg={5}>
            <Link href="/">
              <Typography variant="h4" className={classes.title}>
                <MuiLink href="#" color="inherit" underline="none">
                  Tracthon
                </MuiLink>
              </Typography>
            </Link>
          </Grid>

          <Grid item lg={5}>
            <Button align="right" color="inherit">
              Personal Assistance
            </Button>

            <Link href="/">
              <Button align="right" color="inherit">
                Home
              </Button>
            </Link>

            <Link href="/about">
              <Button align="right" color="inherit">
                About
              </Button>
            </Link>

            <Button align="right" color="inherit">
              Login
            </Button>
          </Grid>

          <Grid item lg={1}></Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
